import React from 'react'
import player_score_bar from '../player_score_bar'
import './style.css'


export default function Scoreboard(players) {
	return (
		<section className="c-score-table">
			{	
			players.players.map((player) => (
				<Player_score_bar
		          name = {player.name}
		          key = {player.name}
		          score = {player.score}
				 />
				))
			}
		</section>
		)
}
